import { Col, Row } from "react-bootstrap"

const arrays = [
    {
        id: 1,
        name: 'Mark'
    },
    {
        id: 2,
        name: 'Mark'
    },
    {
        id: 3,
        name: 'Mark'
    },
    {
        id: 4,
        name: 'Nura'
    },
]

const ArrayMaps = arrays.map(
    (array) => 
    
    <Row key = {array.id}>
        <Col sm ="12" md = "6" lg = "6">
            {array.name}
        </Col>
    </Row>
)

function Array(){
    return(
        {ArrayMaps}
    )
}

export default Array
